import './mainUserInfo.css'

import React  from "react";

export default function MainUserInfo (props){
    const u = props.usuario;
    return (
        <div className='mainInfo' >
            <h2> Primary user information </h2>
            <ul>
                <li> {u.username} </li>
                <li> {u.email}</li>
                <li> {u.firstName} </li>
                <li>{ u.lastName }</li>
            </ul>
            <img src={u.image} alt="Profile Img"></img>
        </div>
    );
}
